import React from 'react'
import { Link } from 'react-router-dom'

const ActionButton = ({data}) => {
  return (
    <td>
        <Link to={`../edit-product/${data.id}`} className="action-icon"> <i className="mdi mdi-square-edit-outline"></i></Link>
        <Link href="javascript:void(0);" className="action-icon"> <i className="mdi mdi-delete"></i></Link>
    </td>
  )
}

export default ActionButton
